import { library } from '@fortawesome/fontawesome-svg-core';
import { fas } from '@fortawesome/free-solid-svg-icons';
import { fab,faFacebook,faInstagramSquare,faTwitterSquare } from '@fortawesome/free-brands-svg-icons';

library.add(fab,fas,faFacebook,faInstagramSquare,faTwitterSquare);
